import React from 'react';
import './App.css';

import NavBar from './components/organisms/NavBar';
import Footer from './components/organisms/Footer';
import College from './components/template/college';

function App() {
  return (
    <div className="App">
        <NavBar />
        <h1>Texto</h1>
        <p>Pequeno texto apenas para demonstação em layout de desenvolvimento</p>
        <Footer />
    </div>
  )
}

export default App;
